        <div className="mb-3 mt-3">
        <div style={{display:"flex",justifyContent:"flex-start",alignItems:"center", marginBottom:"2%"}}>
        <i class="big user icon"></i>
        <p className="form-label lead">Username</p>
        </div>
        <input type="username" className="form-control" id="exampleFormControlInput1" placeholder="Enter username"/>
        </div>
        <div className="mb-3">
        <div style={{display:"flex",justifyContent:"flex-start",alignItems:"center", marginBottom:"2%"}}>
        <i class="big keyboard icon"></i>
        <p className="form-label lead">Password</p>
        </div>
        <input type="password" className="form-control" id="exampleFormControlInput1" placeholder="Enter Password"/>
        </div>
        <div align="center" className='d-grid gap-2'>
        <button type="button" className="btn btn-dark" onClick={ () => {navigate("/")}}>Login</button>
        </div>
        </div>





    )
}

export default Login;
